import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/WhoWeAre.css";

// IMPORT IMAGES (IMPORTANT ‚Äì fixes image not showing issue)
import img1 from "../../assets/gallery/images/gallery1.jpg";
import img2 from "../../assets/gallery/images/gallery2.jpg";
import img3 from "../../assets/gallery/images/gallery3.jpg";

const images = [img1, img2, img3];

function WhoWeAre() {
  const [heroIndex, setHeroIndex] = useState(0);
  const [mainIndex, setMainIndex] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const heroTimer = setInterval(() => {
      setHeroIndex(prev => (prev + 1) % images.length);
    }, 4500);
    return () => clearInterval(heroTimer);
  }, []);

  /* MAIN SLIDESHOW */
  useEffect(() => {
    const mainTimer = setInterval(() => {
      setMainIndex(prev => (prev + 1) % images.length);
    }, 5000);
    return () => clearInterval(mainTimer);
  }, []);

  /* REVEAL ANIMATIONS */
  useEffect(() => {
    const reveals = document.querySelectorAll(".reveal");
    const observer = new IntersectionObserver(
      entries => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            entry.target.classList.add("visible");
          }
        });
      },
      { threshold: 0.15 }
    );

    reveals.forEach(el => observer.observe(el));
    return () => observer.disconnect();
  }, []);

  return (
    <div className="rgm-who-page">

      {/* HERO WITH SLIDESHOW */}
      <section className="rgm-who-hero">
        <div className="hero-slideshow">
          <img src={images[heroIndex]} alt="RGM Culture" />
        </div>

        <div className="hero-overlay">
          <h1>More Than a Company</h1>
          <p>At RGM, You‚Äôre Not a Number ‚Äî You‚Äôre Family</p>
        </div>
      </section>

      {/* STORY + MAIN SLIDESHOW */}
      <section className="rgm-who-story reveal">
        <div className="story-grid">

          <div className="story-text">
            <h2>Who We Are</h2>
            <p>
              RGM was founded with one clear vision ‚Äî to build a trucking and
              logistics company that puts people first.
            </p>
            <p>
              We may be a young company, but our values are deeply rooted in
              honesty, respect, and loyalty. We believe success comes from
              taking care of the people who make the work happen every day.
            </p>
          </div>

          <div className="story-slideshow">
            <img src={images[mainIndex]} alt="RGM Team & Operations" />
          </div>

        </div>
      </section>

      {/* VALUES */}
      <section className="rgm-who-values reveal">
        <h2>Our Family Values</h2>

        <div className="values-grid">
          <div className="value-card">
            <h3>ü§ù Family Over Everything</h3>
            <p>Once you‚Äôre with RGM, you‚Äôre part of our family.</p>
          </div>

          <div className="value-card">
            <h3>üõ£ Built on Respect</h3>
            <p>We respect your time, effort, and responsibility.</p>
          </div>

          <div className="value-card">
            <h3>üí¨ Honest Communication</h3>
            <p>Clear, transparent, and open communication.</p>
          </div>

          <div className="value-card">
            <h3>‚≠ê Growing Together</h3>
            <p>As RGM grows, our people grow with us.</p>
          </div>
        </div>
      </section>

      {/* CTA */}
      <section className="rgm-who-cta reveal">
        <h2>Welcome to the RGM Family</h2>
        <p>
          Whether you drive with us, ship with us, or grow with us ‚Äî
          RGM is a place where people matter.
        </p>

        <div className="cta-buttons">
          <Link to="/contact" className="cta-primary">Contact Us</Link>
          <Link to="/join/apply" className="cta-secondary">Join the Family</Link>
        </div>
      </section>

    </div>
  );
}

export default WhoWeAre;
